import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Product from './pages/Adicionar';

export default function Routes() {
    return(
        <BrowserRouter>
            <Switch>
                <Route path="/product" component={Product}/>
            </Switch>

        </BrowserRouter>

    );

}
